import React from 'react';
import Header from './Header';
import Meta from './Meta';
import styled from 'styled-components';

const StyledPage = styled.div`
  background: white;
  color: black;
`;

const Page = props => {
  return (
    <StyledPage>
      <Meta />
      <Header />     
      {props.children}
    </StyledPage>
  )
};

export default Page;
